import FlightLandIcon from '@material-ui/icons/FlightLand';
import SearchBar from "./SearchBar";
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import "./StartingPage.css";



const cities = [
    "Paris",
    "London"];

function SearchBarContainer() {
    // return <div style={{backgroundImage: "url(https://i.imgur.com/oPNn9fZ.jpg)"}}  className="container">
    // <div className="row justify-content-center align-items-center">
    return 
    <Grid container spacing={3} justify="center" alignItems="center">
    <Grid item xs={12} sm={6} direction="row">
    <FlightTakeoffIcon fontSize="large" />
    <SearchBar name="originSearchBar" label="Origin city"/>
    </Grid>
    <Grid item xs={12} sm={6}>
    <FlightLandIcon fontSize="large"/>
    <SearchBar name="destinationSearchBar" label="Desination city"/>
    </Grid>
    </Grid>;
    // </div>
    // </div>
}

export default SearchBarContainer;
